// App.js - The main component that sets up all the pages and their routes.

import React from 'react';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';

// Import all user page components
import Home from './components/Home';
import Register from './components/Register';
import Login from './components/Login';
import Search from './components/Search';
import RequestBlood from './components/RequestBlood';
import Profile from './components/Profile';
import WhyDonate from './components/WhyDonate';
import About from './components/About';
import Contact from './components/Contact';

// Import all admin page components
import AdminLogin from './admin/AdminLogin';
import ManageDonors from './admin/ManageDonors';
import ManageRequests from './admin/ManageRequests';
import StockReport from './admin/StockReport';

function App() {
  return (
    // BrowserRouter is the parent component that enables routing
    <BrowserRouter>
      {/* A simple navigation bar that will appear on every page */}
      <nav>
        <div>
          <Link to="/">Home</Link>
          <Link to="/why-donate">Why Donate?</Link>
          <Link to="/search">Search</Link>
          <Link to="/request-blood">Request Blood</Link>
          <Link to="/about">About</Link>
          <Link to="/contact">Contact</Link>
        </div>
        <div>
          <Link to="/profile">Profile</Link>
          <Link to="/login">Login</Link>
          <Link to="/signup">Signup</Link>
          <Link to="/admin/login">Admin</Link>
        </div>
      </nav>

      {/* The container holds the content of the current page */}
      <div className="container">
        {/* The Routes component holds all the individual Route definitions */}
        <Routes>
          {/* User Routes */}
          <Route path="/" element={<Home />} />
          <Route path="/signup" element={<Register />} />
          <Route path="/login" element={<Login />} />
          <Route path="/search" element={<Search />} />
          <Route path="/request-blood" element={<RequestBlood />} />
          <Route path="/profile" element={<Profile />} />
          <Route path="/why-donate" element={<WhyDonate />} />
          <Route path="/about" element={<About />} />
          <Route path="/contact" element={<Contact />} />

          {/* Admin Routes */}
          <Route path="/admin/login" element={<AdminLogin />} />
          <Route path="/admin/donors" element={<ManageDonors />} />
          <Route path="/admin/requests" element={<ManageRequests />} />
          <Route path="/admin/stock" element={<StockReport />} />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
